    def cutOffTree(self, forest):
        """
        :type forest: List[List[int]]
        :rtype: int
        """

        # find the starting point
        m, n = len(forest), len(forest[0])
        trees = []
        for i in range(m):
            for j in range(n):
                if forest[i][j] > 1:
                    trees.append((forest[i][j], i, j))
        trees.sort()
        if not trees:
            return -1
        sx, sy = trees[0][1], trees[0][2]
        for t in trees[1:]:
            if self.bfs(forest, sx, sy, t[1], t[2]):
                sx, sy = t[1], t[2]
        return self.bfs(forest, sx, sy, m - 1, n - 1)

    def bfs(self, forest, sx, sy, tx, ty):
        m, n = len(forest), len(forest[0])
        q = collections.deque([(sx, sy)])
        visited = set([(sx, sy)])
        step = 0
        while q:
            for _ in range(len(q)):
                x, y = q.popleft()
                if x == tx and y == ty:
                    return step
                for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
                    nx, ny = x + dx, y + dy
