        pivot = self.findPivot(nums)

        # if pivot is -1, then nums is not rotated
        if pivot == -1:
            return self.binarySearch(nums, target)

        # if target is smaller than the first element, search in the right half
        if nums[pivot] < nums[0]:
            return self.binarySearch(nums[pivot:], target)

        # if target is larger than the first element, search in the left half
        return self.binarySearch(nums[:pivot], target)

    def findPivot(self, nums):
        left = 0
        right = len(nums) - 1

        while left < right:
            mid = left + (right - left) // 2

            if nums[mid] > nums[right]:
                left = mid + 1
            else:
                right = mid

